import { styled } from "styled-components";
import profileImg from "../assests/developer.JPG";
import phoneImg from "../assests/phone.svg";
import mailImg from "../assests/mail.svg";
import mapImg from "../assests/map.svg";
import "./profile.css";

const ProfileBox = styled.div`
  border-radius: 1rem;
  border: 1px solid #ebedf8;
  background: #fff;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const ProfileDetailBox = styled.div`
  display: flex;
  gap: 1vw;
`;

const ProfileDetailText = styled.p`
  color: #484a64;
  font-family: Inter;
  font-size: 2vw;
  font-style: normal;
  font-weight: 500;
  line-height: normal;
`;

const NameText = styled.p`
  color: #4a86ff;
  text-align: center;
  font-family: Inter;
  font-size: 3vw;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
`;
export default function ProfileComponent() {
  return (
    <ProfileContainer>
      <ProfileBox>
        <img src={profileImg} alt="profileImg" className="profileImg" />
        <NameText>박제준</NameText>
        <ProfileDetailBox>
          <img src={phoneImg} alt="phoneImg" />
          <ProfileDetailText className="phone">010-3279-7995</ProfileDetailText>
        </ProfileDetailBox>
        <ProfileDetailBox>
          <img src={mailImg} alt="mailImg" />
          <ProfileDetailText>33.beautifulboy@gmail.com</ProfileDetailText>
        </ProfileDetailBox>
        <ProfileDetailBox>
          <img src={mapImg} alt="mapImg" />
          <ProfileDetailText>서울특별시 용산동</ProfileDetailText>
        </ProfileDetailBox>
      </ProfileBox>
    </ProfileContainer>
  );
}
